"use strict";(self.webpackChunkcode_harbor_hub=self.webpackChunkcode_harbor_hub||[]).push([[5276],{98448:a=>{a.exports=JSON.parse('{"title":"Data Types in JavaScript","description":"Data types are the classification or categorization of data items. It represents the kind of value that tells what operations can be performed on a particular data. Since everything is an object in JavaScript, data types are divided into two categories: primitive data types and object data types. Primitive data types are the most basic data types available in JavaScript. They are the building blocks for data manipulation. Object data types are more complex data types and are used to store collections of data and more complex entities.","slug":"/category/data-types-in-javascript","permalink":"/code-harbor-hub/docs/category/data-types-in-javascript","navigation":{"previous":{"title":"Type Operator","permalink":"/code-harbor-hub/docs/javascript/operators/type-operator-in-javascript"},"next":{"title":"Data Types","permalink":"/code-harbor-hub/docs/javascript/datatypes/datatypes-in-javascript"}}}')}}]);